import React from 'react';
import './App.css';
import { Routes, Route } from 'react-router-dom';
import HomePage from './pages/HomePage/HomePage';

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path='/'>
          <HomePage/>
        </Route>
      </Routes>
    </div>
  );
}

export default App;
